import React from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
} from 'chart.js';
import { Line } from 'react-chartjs-2';
import 'chartjs-adapter-date-fns';

// Register Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

const AnxietyRiskChart = ({ 
    title, 
    data, 
    threshold, 
    baseRatio, 
    periodLabel, 
    ageGroup,
    description 
}) => {
    // Debug incoming data
    console.log(`${title} - Incoming data:`, data?.slice(0, 2));

    // Validate and format data
    const validData = data?.filter(point => {
        // Ensure point exists
        if (!point) {
            console.log('Null point found');
            return false;
        }

        // Validate x value
        if (!(point.x instanceof Date)) {
            console.log('Invalid x value:', point.x);
            return false;
        }

        // Validate y value
        if (typeof point.y !== 'number' || isNaN(point.y)) {
            console.log('Invalid y value:', point.y);
            return false;
        }

        return true;
    }) || [];

    // Debug validated data
    console.log(`${title} - Valid data:`, validData.slice(0, 2));

    // If no valid data, show error
    if (!validData.length) {
        return (
            <div className="risk-chart-container">
                <h3>{title}</h3>
                <p className="error-message">No valid data available for this period</p>
            </div>
        );
    }

    const chartData = {
        datasets: [{
            label: 'PM2.5 Levels',
            data: validData,
            borderColor: 'rgb(75, 192, 192)',
            tension: 0.1
        }]
    };

    const chartOptions = {
        responsive: true,
        maintainAspectRatio: false,
        scales: {
            x: {
                type: 'time',
                time: {
                    unit: 'day',
                    displayFormats: {
                        day: 'MMM d'
                    }
                },
                title: {
                    display: true,
                    text: 'Date'
                }
            },
            y: {
                title: {
                    display: true,
                    text: 'PM2.5 (μg/m³)'
                }
            }
        },
        plugins: {
            title: {
                display: true,
                text: title
            },
            tooltip: {
                callbacks: {
                    afterBody: (tooltipItems) => {
                        return [
                            `Threshold: ${threshold} μg/m³`,
                            `Base Ratio: ${baseRatio}`,
                            `Period: ${periodLabel}`,
                            description ? `Note: ${description}` : ''
                        ].filter(Boolean);
                    }
                }
            }
        }
    };

    return (
        <div className="risk-chart-container">
            <h3>{title}</h3>
            <p className="age-notice">Results applicable for {ageGroup}</p>
            <p className="period-notice">Based on {periodLabel} measurements</p>
            <div style={{ height: '300px' }}>
                <Line data={chartData} options={chartOptions} />
            </div>
        </div>
    );
};

export default AnxietyRiskChart;
